DROP TABLE IF EXISTS `platform_dict_area`;
CREATE TABLE `platform_dict_area` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `parent_id` varchar(64) NOT NULL COMMENT '父级编号',
  `parent_ids` varchar(2000) NOT NULL COMMENT '所有父级编号',
  `name` varchar(200) NOT NULL COMMENT '名称',
  `merger_name` varchar(500) NOT NULL COMMENT '地址全称',
  `short_name` varchar(200) NOT NULL COMMENT '简称',
  `merger_short_name` varchar(500) NOT NULL COMMENT '详细简称',
  `type` char(1) NOT NULL COMMENT '区域类型',
  `sort` decimal(10,0) NOT NULL COMMENT '排序',
  `code` varchar(45) DEFAULT NULL COMMENT '区域编号',
  `city_code` varchar(45) DEFAULT NULL COMMENT '城市编号',
  `pinyin` varchar(500) DEFAULT NULL COMMENT '拼音',
  `jianpin` varchar(100) DEFAULT NULL COMMENT '拼音简写',
  `first_char` varchar(45) DEFAULT NULL COMMENT '首字母',
  `position_ing` varchar(64) DEFAULT NULL COMMENT '坐标x',
  `position_lat` varchar(64) DEFAULT NULL COMMENT '坐标y',
  `hot_area` varchar(64) NOT NULL COMMENT '热门地区',
  `remarks` varchar(1000) DEFAULT NULL COMMENT '备注信息',
  `extension1` varchar(500) DEFAULT NULL,
  `extension2` varchar(500) DEFAULT NULL,
  `extension3` varchar(500) DEFAULT NULL,
  `create_time` bigint DEFAULT NULL COMMENT '鍒涘缓鏃堕棿(鏃堕棿鎴?',
  `update_time` bigint DEFAULT NULL COMMENT '鏇存柊鏃堕棿(鏃堕棿鎴?',
  PRIMARY KEY (`id`) USING BTREE,
